import React from 'react';

import Navbar from './components/Navbar';
import './App.css';
import {BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/pages/Home';


function App() {
  return (
      <>
      <Router>
        <Navbar>
          <hi>MySpace</hi>
          <Routes>
            <Route path ='/' exact element = {Home} />
          </Routes>
        </Navbar>
      </Router>
      </>
  );
}
export default App;
